(26,'Monkey Forest','7','11,12,13,14',4,'Step into a magical world at the Sacred Monkey Forest Sanctuary in Ubud, Bali. This enchanting forest, home to over 600 playful long-tailed macaques, offers a unique blend of nature, culture, and spirituality. Wander through lush, green pathways surrounded by ancient temples, and witness the lively monkeys in their natural habitat. Whether you\'re looking to connect with nature, snap unforgettable photos, or simply enjoy the peaceful atmosphere, Monkey Forest Ubud promises an unforgettable adventure for every traveler. Donâ€™t miss this serene escape in the heart of Bali!','Jl. Monkey Forest, Ubud, Kecamatan Ubud, Kabupaten Gianyar, Bali 80571','[\"\",\"\",\"\"]','1. Respect the Monkeys â€“ Observe from a safe distance and avoid provoking them.\n2. Keep Personal Belongings Secure â€“ Monkeys are curious and may try to grab food, bags, or cameras.\n3. Take Photos â€“ Capture the beauty of the forest, wildlife, and ancient temples, but be mindful of your surroundings.\n4. Stay on the Pathways â€“ Stick to the designated walkways to ensure your safety and protect the environment.\n5. Follow the Rules â€“ Respect the guidelines set by the sanctuary to help preserve the area.','1. Donâ€™t Feed the Monkeys â€“ Feeding them can disrupt their natural diet and behavior.\n2. Donâ€™t Touch the Monkeys â€“ Keep a safe distance to avoid stress or aggression.\n3. Donâ€™t Bring Plastic Items â€“ Avoid littering; keep the forest clean.\n4. Donâ€™t Wear Shiny or Food-Scented Items â€“ Monkeys may be attracted to shiny objects or food smells.\n5. Donâ€™t Disturb the Sacred Temples â€“ Be respectful of the cultural and spiritual significance of the temple sites.','1. Stay Alert: Keep an eye on your surroundings, especially when interacting with the monkeys. They are wild animals and may act unpredictably.\n2. Avoid Feeding the Monkeys: Feeding them can cause aggressive behavior and disrupt their natural habits. It is also prohibited within the sanctuary.\n3. Secure Your Belongings: Monkeys may try to grab loose items like bags, sunglasses, or cameras. Keep your belongings close and secured at all times.\n4. Respect the Monkeys\' Space: Donâ€™t approach or attempt to touch the monkeys. Maintain a safe distance for both your safety and theirs.\n5. Watch Your Step: The paths can be uneven and slippery, so wear comfortable shoes and move cautiously, especially during rainy weather.\n6. Do Not Disturb the Temples: The temples inside the sanctuary are sacred. Be respectful and avoid climbing on or touching the structures.\n7. Stay Calm: If a monkey grabs your belongings or behaves aggressively, remain calm. Avoid sudden movements or loud noises, as they may provoke the monkey further.\n8. Follow Staff Instructions: Always listen to the staffâ€™s safety instructions and follow the guidelines to ensure a safe and enjoyable visit.','https://maps.app.goo.gl/GdJBgee9ii3SHAWU8',0,0,'2025-12-20 10:14:55','2025-12-20 10:14:55','09:00 - 18:00'),
(27,'Ubud Art Market','7','15',3,'Ubud Art Market is a vibrant marketplace in the heart of Ubud, Bali, offering a wide range of handmade traditional crafts, clothing, jewelry, and souvenirs. Itâ€™s an excellent spot to experience Baliâ€™s rich artistic heritage. Visitors can explore stalls showcasing batik, wood carvings, paintings, and other unique Balinese items, making it a must-visit for art lovers and souvenir hunters alike. Bargaining is common, so be prepared to negotiate for the best prices.','Jl. Raya Ubud No.35, Ubud, Kecamatan Ubud, Kabupaten Gianyar, Bali 80571','[\"\",\"\",\"\"]','1. Bargain politely for better prices.\n2. Respect the artisans and their work.\n3. Keep your belongings secure.','1. Donâ€™t take photos of vendors without permission.\n2. Avoid overly aggressive bargaining.\n3. Donâ€™t leave valuables unattended.','1. Keep an eye on your personal belongings to avoid theft, especially in crowded areas.\n2. Be cautious while bargaining to avoid misunderstandings.\n3. Wear comfortable footwear, as the market can get crowded and uneven.\n4. Respect the local culture and traditions while shopping.','https://maps.app.goo.gl/mRGpCdWxhihPXXPV6',0,0,'2025-12-20 10:23:05','2025-12-20 10:23:05','10:00 - 17:00'),
(28,'Goa Gajah','7','13,14,12',3,'Goa Gajah, or Elephant Cave, is a historic and sacred site in Ubud, Bali, dating back to the 11th century. Known for its stunning rock carvings, the entrance of the cave features an intricately carved demon face. Inside, you\'ll find ancient Hindu relics, bathing pools, and an archaeological area. This spiritual site is not only a popular tourist attraction but also a place of significance for Balinese culture. Goa Gajah offers visitors a fascinating glimpse into Bali\'s ancient history and spiritual practices, set amidst lush, tranquil surroundings.','Bedulu, Kec. Blahbatuh, Kabupaten Gianyar, Bali','[\"\",\"\",\"\",\"\"]','1. Respect the sacred nature of the site.\n2. Wear appropriate attire (cover shoulders and knees).\n3. Take time to explore the cave and surrounding areas.\n4. Keep your belongings secure, as the site can get busy.','1. Donâ€™t touch or climb on the rock carvings.\n2. Donâ€™t disturb the spiritual ambiance by making noise.\n3. Avoid wearing inappropriate clothing like shorts or sleeveless tops.\n4. Donâ€™t litter â€“ keep the area clean.','1. Be careful when walking on the uneven, slippery stone surfaces around the site.\n2. Always stay within the designated areas to preserve the site.\n3. Keep an eye on your belongings, especially in crowded spots.\n4. Respect local customs and traditions when visiting sacred sites.','https://maps.app.goo.gl/dfW6hJHERF4XrdJM9',0,0,'2025-12-20 10:33:42','2025-12-20 10:33:42','08:00 - 16:00');

